import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
// Import Style
import { Logo } from './styled';

const Text = ( props ) => (
  	<Logo {...props}>
  		<h1><strong>Dash</strong> Elements</h1>
  	</Logo>
);

export default(Text);
